import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

export default class WorkoutsList extends Component {
    constructor(props) {
        super(props);
        this.deleteWorkouts = this.deleteWorkouts.bind(this);
        this.state = {workouts: []};
      }

      componentDidMount() {
        axios.get('http://localhost:5000/workouts/')
         .then(response => {
           this.setState({ workouts: response.data });
         })
         .catch((error) => {
            console.log(error);
         })
      }

      deleteExercise(id) {
        axios.delete('http://localhost:5000/workouts/'+id)
          .then(res => console.log(res.data));
        this.setState({
          workouts: this.state.workouts.filter(el => el._id !== id)
        })
      }

  render() {
    return (
      <div>
        <p>You are on the Workouts List component!</p>
      </div>
    )
  }
}
